import React from 'react';
// import Chart from 'chart.js';

const Chart = props => {
  const data = props.resp;
  data.map(t => {
    console.log(t.date);
    console.log(t.positive);
    console.log(t.positiveIncrease);
    console.log(t.death);
  });

  return <h1> Hello there</h1>;
};

export default Chart;
